import style from 'styled-components';

const ButtonStyled = styled.button`
  color: maroon;
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid;
  border-radius: 3px;
  display: inline-block;
`;

export default function Button(props){

    return (
        <ButtonStyled>
            <button className={style.btn} onClick={props.onClick} style={props.style} > {props.text}</button>
        </ButtonStyled>
    )
}
